import React, { Component } from 'react';
import { Navbar, Nav, NavDropdown } from 'react-bootstrap';
import { BrowserRouter, Switch, Route } from 'react-router-dom';
import Instruction from './instructions';
import BondValuation from './bond_valuation';
import BondExample from './bond_example';
import logo from '../images/logo.png';

class Navigation extends Component {
    constructor(props) {
        super(props);
        this.state = {
        };
    }

    render() {
        return (
            <BrowserRouter>
                <Navbar bg="dark" variant="dark">
                    <Navbar.Brand> <img
                        src={logo}
                        width="30"
                        height="30"
                        alt="TREASURY BOND PRICING TOOL"
                    /></Navbar.Brand>
                    <Navbar.Brand>TREASURY BOND PRICING TOOL</Navbar.Brand>
                    <Nav.Link href="/instructions" style={{ fontSize: '14px', fontWeight: '500' }}>INSTRUCTIONS</Nav.Link>
                    <Nav.Link href="/bond_example" style={{ fontSize: '14px', fontWeight: '500' }}>BOND EXAMPLE</Nav.Link>
                    <NavDropdown title="BOND PRICING" id="basic-nav-dropdown" style={{ fontSize: '14px', fontWeight: '500' }}>
                        <NavDropdown.Item href="/">LOOKUP BY INDIVIDUAL BOND</NavDropdown.Item>
                        <NavDropdown.Divider />
                        <NavDropdown.Item href="/bond_valuation">LOOKUP BY A SPREADSHEET OF BONDS</NavDropdown.Item>
                    </NavDropdown>
                </Navbar>
                <Switch>
                    <Route exact path='/instructions' component={Instruction} />
                    <Route exact path='/bond_example' component={BondExample} />
                    <Route exact path='/bond_valuation' component={BondValuation} />
                </Switch>
            </BrowserRouter>)

    }
}

export default Navigation;
